import React, { useEffect, useState } from "react"

const UserProfile = () => {
  const [users, setUsers] = useState([])

  const fetchUserData = () => {
    fetch("/clients")
      .then(response => response.json())
      .then(data => setUsers(data))
  }

  useEffect(() => {
    fetchUserData()
  }, [])

  return (
    <div>
      {users.length > 0 && (
        <ul>
          {users.map(user => (
            <li key={user.id}>{user.name}</li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default UserProfile;
